import { Link } from "react-router-dom";
import React from "react";

export const Dashboard = () => {
    return (
        <div className="bg-gray-100 min-h-screen flex justify-center items-center">
            <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-screen-lg w-full">
                <Link to="/applications">
                    <div className="bg-white p-8 rounded-xl flex justify-center items-center">
                        <h2 className="text-3xl font-bold">Review new applications</h2>
                    </div>
                </Link>
                <Link to="/forms">
                    <div className="bg-white p-8 rounded-xl flex justify-center items-center">
                        <h2 className="text-3xl font-bold">Enter data</h2>
                    </div>
                </Link>
                <Link to="/register">
                    <div className="bg-white p-8 rounded-xl flex justify-center items-center">
                        <h2 className="text-3xl font-bold">Register applicant</h2>
                    </div>
                </Link>
            </div>
        </div>
    );
};

export default Dashboard;
